choice.onclick:
///$debug
//Bascule valeurs et états des champs en fonction de l'utilisation ou non d'un template d'évènement
switchTemplateUse();

check.onclick:
///$debug
var /*Field2*/ currentCheckBoxField=meibo.getCurrentField();
var /*Field2*/ otherCheckBoxField=meibo.getField("TET_ISTEMPLATE");
// uncheck the other field
if(currentCheckBoxField.isChecked() && otherCheckBoxField.isChecked()){
  otherCheckBoxField.check(false);
}

var /*Field2*/ currentCheckBoxField=meibo.getCurrentField();
var /*Field2*/ otherCheckBoxField=meibo.getField("TET_ISPRIVATE");
// uncheck the other field
if(currentCheckBoxField.isChecked() && otherCheckBoxField.isChecked()){
  otherCheckBoxField.check(false);
}
